        mode: 'readwrite',
        // Remove startIn to avoid potential issues on some systems
      });

      console.log('[BackupService] Directory selected:', directoryHandle?.name || 'null');

      if (!directoryHandle) {
        console.warn('[BackupService] showDirectoryPicker returned null/undefined');
